import { OuterWrapper, InnerWrapper, LastSection, H1 } from 'styles/MainStyles';
import Footer from 'components/Footer';

const Contact = () => {

    return (
    <>
    <OuterWrapper>
        <InnerWrapper>
        <LastSection>
    <H1>PHONE</H1>
    <H1>EMAIL</H1>
    </LastSection>
    </InnerWrapper>
    </OuterWrapper>
    <Footer/>
    </>
    )
}

export default Contact;
